const layoutStyle = {
  backgroundColor: 'gray',
    border: 'none',
    color: 'white',
    padding: '20px',
    textAlign: 'center',
    textDecoration: 'none',
    display: 'inline-block',
    fontSize: '16px',
    margin: '4px 2px',
    borderRadius: '50%',
    width:'15vw'
};

const Layout = props => (
  <div style={{display:'inline-block'}}>
    <button style={layoutStyle}>Next</button>
  </div>
);

export default Layout;
